Kasanoak a Makaala iti Nangato a Grado? Ania ti mabalinmo nga aramiden Agbalinka a positibo! Mabalin a dika agballigi no ipapanmo a saanmo a kabaelan ti rumang-ay. No sumken ti negatibo a kapanunotan maipapan kadagiti abilidadmo, sukatam dayta iti positibo a kapanunotan. Kas pagarigan, idi binabalaw dagiti tattao ti panagpalpalawag ni Pablo (uray no nalabit di nainkalintegan dayta), insungbatna: “ Uray pay no saanak a nasigo iti panagsasao, pudno a saanak a kasta no iti pannakaammo.” (2 Corinto 
..........
ayatmo a nasayaat ti magapuanam idiay eskuelaan, masapul a saetam ti agadal. Mabalin a kasla saan a makaay-ayo kenka ti sao a “panagadal.” Ngem makagunggona dayta. Kinapudnona, matagiragsakmo ti agadal no nayonam ti panagreggetmo. Nupay kasta, tapno mapatanormo dagiti nasayaat nga ugali iti panagadal, kasapulan nga ammom nga usaren ti tiempom. Laglagipem a ti panagadalmo ti iyun-unam. Pudno a kuna ti Biblia nga adda “ tiempo ti panagkatawa” ken “ tiempo ti panaglagtolagto.” (Eclesiastes 3:1, 4;
